import { useState } from 'react';
import { useNavigate } from 'react-router-dom';

export default function DoctorAccount() {
    return (
        <div>
            <h1 className='title'>Health Portal</h1>
            <h3 className='choose-account'>Choose an Account</h3>
            <div className='button-container'>
                <button className="role-button" onClick={() => returnRole("doctor")}>Doctor</button>
                <button className="role-button" onClick={() => returnRole("patient")}>Patient</button>
            </div>
        </div>
    )
}
